import AOS from 'aos';
import './app.css'
import Header from './components/Header/Header';
import Footer from './components/Footer/Footer';
import Mail from './components/Mail/Mail';


const App = ({ children }) => {
  AOS.init()
  return (
    <>
      <Header />
      <div className="wrapper" id="wrapper">
        <main className='main'>
        {children}
        </main>
      </div>
      <Mail />
      <Footer />
    </>
  )
}

export default App
